import Exercise from './Exercise';

const Hello = (props) => {
  return (
    <div>
      <p>
        Hello {props.name} you are {props.age} years old.
      </p>
    </div>
  );
};



const App = () => {
  const now = new Date().toISOString();
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Andrei" age={17 + 10} />
      <p>{now}</p>
      <div>
        <Exercise />
      </div>
    </div>
  );
};

export default App;
